import PostCard from '../PostCard/PostCard';

// import './PostCardList.css';

const PostCardList = ({reservePlate,plates}) => {
	const allPlates = plates.map((plate,i) => {
		return(
			<PostCard 
			onReserveClick = {()=>reservePlate(i)}
			key ={i}
			Name = {plates[i].plateName}
			price = {plates[i].platePrice}
			description = {plates[i].plateDescription}
			url = {plates[i].url}
			/>
		)
	})


	return(
		<div style = {{marginTop:'100px'}}>

			{allCards}

		</div>

	)

}
export default PostCardList;
